import {
  BrowerRouter as Router,
  Switch,
  Route,
} from 'react-router-dom'
import Following from './pages/Following';
import Home from './pages/Home';

function App() {
  return (
    <Router>
      <div className='App'>
        <Routes>
          <Router path="/" element={<Home />} />
          <Router path="/following" element={<Following />} />
        </Routes>
      </div>
    </Router>
  )
}
export default App;
